INSERT INTO `nbw_posts` VALUES (1,1,'2020-04-17 04:12:33','2020-04-17 04:12:33','<!-- wp:paragraph -->\n<p>Cảm ơn vì đã sử dụng WordPress. Đây là bài viết đầu tiên của bạn. Sửa hoặc xóa nó, và bắt đầu bài viết của bạn nhé!</p>\n<!-- /wp:paragraph -->','Chào tất cả mọi người!','','publish','open','open','','chao-moi-nguoi','','','2020-04-17 04:12:33','2020-04-17 04:12:33','',0,'http://giaykhamsuckhoe.muathemewordpress.net/?p=1',0,'post','',0),(2,1,'2020-04-17 04:12:33','2020-04-17 04:12:33','[section]\n\n[row]\n\n[col span__sm=\"12\" align=\"center\"]\n\n<div class=\"elementor-element elementor-element-8df9765 elementor-widget elementor-widget-heading\" data-id=\"8df9765\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\n<div class=\"elementor-widget-container\">\n<h1 class=\"elementor-heading-title elementor-size-default\" style=\"text-align: center;\"><span style=\"color: #009ee2; font-size: 130%;\">RẺ NHẤT HÀ NỘI</span></h1>\n</div>\n</div>\n<div class=\"elementor-element elementor-element-8bfd687 elementor-widget elementor-widget-heading\" data-id=\"8bfd687\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\n<div class=\"elementor-widget-container\">\n<h1 class=\"elementor-heading-title elementor-size-xl\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 160%;\">CHUẨN THÔNG TƯ 14 /2013/TT-BYT</span></h1>\n</div>\n</div>\n[button text=\"Chat Zalo: 0999.999.999\" letter_case=\"lowercase\" size=\"larger\" radius=\"99\" link=\"#\"]\n\n<h2 class=\"elementor-heading-title elementor-size-large\" style=\"text-align: center;\"><span style=\"color: #ed1c24;\">GIẤY KHÁM SỨC KHOẺ ONLINE - SHIP TẬN NƠI - DỊCH VỤ</span></h2>\n[gap]\n\n[row_inner style=\"small\"]\n\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"36\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Phỏng vấn xin việc</h3>\n<p style=\"text-align: center;\">Giấy khám sức khỏe rất cần thiết để đi phỏng vấn xin việc, đặc biệt là các công ty nước ngoài </p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"37\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Học tập, du học</h3>\n<p style=\"text-align: center;\">Giấy khám sức khỏe cần cho các trường hợp nhập học cao đẳng, đại học hoặc đi du học nước ngoài</p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"38\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Xét nghiệm sức khỏe</h3>\n<p style=\"text-align: center;\">Giấy khám sức khỏe cần để thực hiện các xét nghiệm y tế hoặc phẫu thuật liên quan tới sức khỏe</p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"35\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Thi bằng lái xe</h3>\n<p style=\"text-align: center;\">Thi bằng lái xe máy hoặc ô tô buộc phải có giấy khám sức khỏe, đủ tiêu chuẩn mới được thi</p>\n\n[/featured_box]\n\n[/col_inner]\n\n[/row_inner]\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(244, 244, 244)\" padding=\"44px\" class=\"section2\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"bieu-mau\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">MỘT SỐ LOẠI GIẤY KHÁM SỨC KHỎE PHỔ BIẾN</span></h2>\n<p style=\"text-align: center;\">Tùy nhu cầu của bạn để chọn loại giấy khám sức khỏe phù hợp như sau:</p>\n\n[/col]\n\n[/row]\n[row style=\"collapse\"]\n\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">A3 không ảnh</span></h3>\n[ux_image id=\"81\" image_size=\"original\"]\n\n<p style=\"text-align: center;\"><span style=\"font-size: 100%;\">Không giáp lai, </span><span style=\"font-size: 100%;\">Tự dán ảnh, </span><span style=\"font-size: 100%;\">Phí ship nội thành 25 nghìn</span></p>\n[button text=\"Giá: 100,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">A3 có ảnh</span></h3>\n[ux_image id=\"77\" image_size=\"original\"]\n\n<p style=\"text-align: center;\">Có dấu giáp lai ảnh, Chuẩn TT14, 4 mặt, phí ship nội thành 25K</p>\n[button text=\"Giá: 150,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">Lái xe</span></h3>\n[ux_image id=\"75\" image_size=\"original\"]\n\n<p style=\"text-align: center;\">Dành cho thi bằng lái, chuẩn Bộ GTVT, có phiếu xét nghiệm</p>\n[button text=\"Giá: 250,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">A4 thường</span></h3>\n[ux_image id=\"79\" image_size=\"original\"]\n\n<p style=\"text-align: center;\">Chuẩn 1 mặt, không có ảnh, ship nội thành 25.000đ trong 30 phút</p>\n[button text=\"Giá: 50,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section class=\"section3\"]\n\n[row]\n\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">90%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">người chọn làm A3 có ảnh</span></h3>\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">80%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">làm thi lái xe</span></h3>\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">50%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">người làm A3 không ảnh</span></h3>\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">20%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">người làm A4 không ảnh</span></h3>\n\n[/col]\n\n[/row]\n[gap]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"luu-y\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">MỘT SỐ LƯU Ý CHUNG</span></h2>\n<p style=\"text-align: center;\">Khách hàng vui lòng xem qua một số lưu ý chung về dịch vụ của chúng tôi</p>\n\n[/col]\n[col span=\"4\" span__sm=\"12\" align=\"left\"]\n\n<ul class=\"elementor-icon-list-items\">\n<li class=\"elementor-icon-list-item\"><span style=\"font-size: 120%; color: #282828;\"><strong><span class=\"elementor-icon-list-text\">Phí ship nội thành 25k. Ship gấp 40k</span></strong></span></li>\n<li class=\"elementor-icon-list-item\"><span style=\"font-size: 120%; color: #282828;\"><strong><i class=\"fas fa-search\" aria-hidden=\"true\"></i><span class=\"elementor-icon-list-text\">Tự điền thông tin cá nhân</span></strong></span></li>\n</ul>\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n<ul class=\"elementor-icon-list-items\">\n<li class=\"elementor-icon-list-item\"><span style=\"color: #282828;\"><span style=\"font-size: 17.28px;\"><b>A4 và A3 thường có ngay khi liên hệ</b></span></span></li>\n<li class=\"elementor-icon-list-item\"><span style=\"color: #282828;\"><strong><span style=\"font-size: 120%;\"><i class=\"fas fa-search-dollar\" aria-hidden=\"true\"></i><span class=\"elementor-icon-list-text\">Giá rất tốt khi làm số lượng nhiều</span></span></strong></span></li>\n</ul>\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n<ul class=\"elementor-icon-list-items\">\n<li class=\"elementor-icon-list-item\"><span style=\"color: #282828;\"><strong><span class=\"elementor-icon-list-text\" style=\"font-size: 120%;\">A3 có giáp lai gửi ảnh vào Zalo</span></strong></span></li>\n<li class=\"elementor-icon-list-item\"><span style=\"color: #282828;\"><strong><span style=\"font-size: 120%;\"><i class=\"fas fa-phone-alt\" aria-hidden=\"true\"></i><span class=\"elementor-icon-list-text\">Hotline và Viber: 0369887119</span></span></strong></span></li>\n</ul>\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(246, 246, 246)\" padding=\"44px\" class=\"section4\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"khach-hang\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">KHÁCH HÀNG CỦA CHÚNG TÔI</span></h2>\n<p style=\"text-align: center;\">Mời bạn xem một số khách hàng tiêu biểu của chúng tôi trong tuần qua</p>\n<p style=\"text-align: center;\">[table id=1 /]</p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section padding=\"42px\" class=\"section5\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"phan-hoi\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">PHẢN HỒI CỦA KHÁCH HÀNG</span></h2>\n<p style=\"text-align: center;\">Mời bạn cùng đọc các phản hồi mà khách hàng gửi lại cho chúng tôi</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"142\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Nguyệt Hoa (Kế toán)</span></h3>\n<p>Mình đã làm lần thứ 2 ở đây, nhanh chóng lại còn rẻ nữa</p>\n\n[/featured_box]\n[featured_box img=\"146\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Hà Linh (Phiên dịch Tiếng Anh)</span></h3>\n<p>Được bạn bè giới thiệu, mình ở nhà gửi thông tin rồi đợi là có, thật sự rất tiện lợi!</p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"150\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Anh Hùng (Kiến trúc sư)</span></h3>\n<p>Bận không có thời gian đi khám, làm ở đây 30 phút là có</p>\n\n[/featured_box]\n[featured_box img=\"152\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Hương Anh (Giáo viên tiếng anh)</span></h3>\n<p>Ông xã bận rộn, thật may là mình biết được ở đây làm dịch vụ. Cảm ơn rất nhiều ?</p>\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(244, 244, 244)\" padding=\"45px\" class=\"section6\"]\n\n[row]\n\n[col span=\"5\" span__sm=\"12\"]\n\n[ux_image id=\"166\" image_size=\"original\"]\n\n\n[/col]\n[col span=\"7\" span__sm=\"12\"]\n\n<h2><span class=\"elementor-counter-number\" style=\"font-size: 350%; color: #ed1c24;\" data-duration=\"2000\" data-to-value=\"15938\" data-from-value=\"5\">15938</span></h2>\n<p><span style=\"color: #282828; font-size: 200%;\"><strong>Số khách hàng đã làm tại Giaykhamsuckhoea3.com</strong></span></p>\n<p><span style=\"color: #1bbb01; font-size: 140%;\">Khách làm số lượng lớn, chat zalo có giá cực tốt nha!</span></p>\n[button text=\"Chat zalo: 0999.999.999\" letter_case=\"lowercase\" size=\"large\" radius=\"99\" link=\"#\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(255, 255, 255)\" padding=\"45px\" class=\"section7\"]\n\n[row style=\"small\"]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"mau-giay\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">MẪU GIẤY KHÁM SỨC KHỎE A3 CHUẨN NHẤT</span></h2>\n<p style=\"text-align: center;\">Dưới đây là mẫu giấy khám sức khỏe A3 chuẩn Thông tư 14 (Click để phóng to)</p>\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"172\" image_size=\"original\" lightbox=\"true\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"173\" image_size=\"original\" lightbox=\"true\"]\n\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image id=\"174\" image_size=\"original\" lightbox=\"true\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(247, 247, 247)\" padding=\"44px\" class=\"section8\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"lien-he\" style=\"text-align: center