mentor-element elementor-element-8df9765 elementor-widget elementor-widget-heading\" data-id=\"8df9765\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\n<div class=\"elementor-widget-container\">\n<h1 class=\"elementor-heading-title elementor-size-default\" style=\"text-align: center;\"><span style=\"color: #009ee2; font-size: 130%;\">RẺ NHẤT HÀ NỘI</span></h1>\n</div>\n</div>\n<div class=\"elementor-element elementor-element-8bfd687 elementor-widget elementor-widget-heading\" data-id=\"8bfd687\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\n<div class=\"elementor-widget-container\">\n<h1 class=\"elementor-heading-title elementor-size-xl\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 160%;\">CHUẨN THÔNG TƯ 14 /2013/TT-BYT</span></h1>\n</div>\n</div>\n[button text=\"Chat Zalo: 0999.999.999\" letter_case=\"lowercase\" size=\"larger\" radius=\"99\" link=\"#\"]\n\n<h2 class=\"elementor-heading-title elementor-size-large\" style=\"text-align: center;\"><span style=\"color: #ed1c24;\">GIẤY KHÁM SỨC KHOẺ ONLINE - SHIP TẬN NƠI - DỊCH VỤ</span></h2>\n[gap]\n\n[row_inner style=\"small\"]\n\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"36\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Phỏng vấn xin việc</h3>\n<p style=\"text-align: center;\">Giấy khám sức khỏe rất cần thiết để đi phỏng vấn xin việc, đặc biệt là các công ty nước ngoài </p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"37\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Học tập, du học</h3>\n<p style=\"text-align: center;\">Giấy khám sức khỏe cần cho các trường hợp nhập học cao đẳng, đại học hoặc đi du học nước ngoài</p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"38\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Xét nghiệm sức khỏe</h3>\n<p style=\"text-align: center;\">Giấy khám sức khỏe cần để thực hiện các xét nghiệm y tế hoặc phẫu thuật liên quan tới sức khỏe</p>\n\n[/featured_box]\n\n[/col_inner]\n[col_inner span=\"3\" span__sm=\"6\"]\n\n[featured_box img=\"35\" img_width=\"140\" pos=\"center\"]\n\n<h3 style=\"text-align: center;\">Thi bằng lái xe</h3>\n<p style=\"text-align: center;\">Thi bằng lái xe máy hoặc ô tô buộc phải có giấy khám sức khỏe, đủ tiêu chuẩn mới được thi</p>\n\n[/featured_box]\n\n[/col_inner]\n\n[/row_inner]\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(244, 244, 244)\" padding=\"44px\" class=\"section2\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"bieu-mau\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">MỘT SỐ LOẠI GIẤY KHÁM SỨC KHỎE PHỔ BIẾN</span></h2>\n<p style=\"text-align: center;\">Tùy nhu cầu của bạn để chọn loại giấy khám sức khỏe phù hợp như sau:</p>\n\n[/col]\n\n[/row]\n[row style=\"collapse\"]\n\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">A3 không ảnh</span></h3>\n[ux_image id=\"81\" image_size=\"original\"]\n\n<p style=\"text-align: center;\"><span style=\"font-size: 100%;\">Không giáp lai, </span><span style=\"font-size: 100%;\">Tự dán ảnh, </span><span style=\"font-size: 100%;\">Phí ship nội thành 25 nghìn</span></p>\n[button text=\"Giá: 100,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">A3 có ảnh</span></h3>\n[ux_image id=\"77\" image_size=\"original\"]\n\n<p style=\"text-align: center;\">Có dấu giáp lai ảnh, Chuẩn TT14, 4 mặt, phí ship nội thành 25K</p>\n[button text=\"Giá: 150,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">Lái xe</span></h3>\n[ux_image id=\"75\" image_size=\"original\"]\n\n<p style=\"text-align: center;\">Dành cho thi bằng lái, chuẩn Bộ GTVT, có phiếu xét nghiệm</p>\n[button text=\"Giá: 250,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n[col span=\"3\" span__sm=\"6\" padding=\"10px 10px 10px 10px\" align=\"center\" bg_color=\"rgb(255, 255, 255)\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 120%;\">A4 thường</span></h3>\n[ux_image id=\"79\" image_size=\"original\"]\n\n<p style=\"text-align: center;\">Chuẩn 1 mặt, không có ảnh, ship nội thành 25.000đ trong 30 phút</p>\n[button text=\"Giá: 50,000đ\" letter_case=\"lowercase\" color=\"secondary\" radius=\"99\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section class=\"section3\"]\n\n[row]\n\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">90%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">người chọn làm A3 có ảnh</span></h3>\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">80%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">làm thi lái xe</span></h3>\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">50%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">người làm A3 không ảnh</span></h3>\n\n[/col]\n[col span=\"3\" span__sm=\"6\"]\n\n<h3 style=\"text-align: center;\"><span style=\"font-size: 250%; color: #ed1c24;\">20%</span></h3>\n<h3 style=\"text-align: center;\"><span style=\"color: #1bbb01;\">người làm A4 không ảnh</span></h3>\n\n[/col]\n\n[/row]\n[gap]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 