44px\" class=\"section4\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"khach-hang\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">KHÁCH HÀNG CỦA CHÚNG TÔI</span></h2>\n<p style=\"text-align: center;\">Mời bạn xem một số khách hàng tiêu biểu của chúng tôi trong tuần qua</p>\n<p style=\"text-align: center;\">[table id=1 /]</p>\n\n[/col]\n\n[/row]\n\n[/section]\n[section padding=\"42px\" class=\"section5\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<h2 id=\"phan-hoi\" style=\"text-align: center;\"><span style=\"color: #ed1c24; font-size: 120%;\">PHẢN HỒI CỦA KHÁCH HÀNG</span></h2>\n<p style=\"text-align: center;\">Mời bạn cùng đọc các phản hồi mà khách hàng gửi lại cho chúng tôi</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"142\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Nguyệt Hoa (Kế toán)</span></h3>\n<p>Mình đã làm lần thứ 2 ở đây, nhanh chóng lại còn rẻ nữa</p>\n\n[/featured_box]\n[featured_box img=\"146\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Hà Linh (Phiên dịch Tiếng Anh)</span></h3>\n<p>Được bạn bè giới thiệu, mình ở nhà gửi thông tin rồi đợi là có, thật sự rất tiện lợi!</p>\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n[featured_box img=\"150\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Anh Hùng (Kiến trúc sư)</span></h3>\n<p>Bận không có thời gian đi khám, làm ở đây 30 phút là có</p>\n\n[/featured_box]\n[featured_box img=\"152\" pos=\"left\"]\n\n<h3><span style=\"color: #ffffff;\">Hương Anh (Giáo viên tiếng anh)</span></h3>\n<p>Ông xã bận rộn, thật may là mình biết được ở đây làm dịch vụ. Cảm ơn rất nhiều ?</p>\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section bg_color=\"rgb(244, 244, 244)\" padding=\"45px\" class=\"section6\"]\n\n[row]\n\n[col span=\"5\" span__sm=\"12\"]\n\n[ux_image id=\"166\" image_size=\"original\"]\n\n\n[/col]\n[col span=\"7\" span__sm=\"12\"]\n\n<h2><span class=\"elementor-counter-number\" style=\"font-size: 350%; 